import React from "react";
import "../../styles/Auth.css";

const to = (path: string) => {
  // CRA'de proxy var: /api -> 8080
  window.location.href = path;
};

export default function OAuthButtons() {
  return (
    <div className="oauth">
      <button className="oauth-btn" onClick={() => to("/api/oauth/google")}>
        <img className="oauth-icon" alt="G" src="https://www.gstatic.com/firebasejs/ui/2.0.0/images/auth/google.svg" />
        Continue with Google
      </button>
      <button className="oauth-btn" onClick={() => to("/api/oauth/microsoft")}>
        <img className="oauth-icon" alt="MS" src="https://img.icons8.com/color/48/microsoft.png" />
        Continue with Microsoft
      </button>
    </div>
  );
}
